pragma solidity >= 0.7.0 < 0.9.0;

contract LearnErrorHandling {
    bool public sunny = true;
    uint finalCalc = 0;

    function solarCalc() public {
        require(sunny, 'It is not sunny today!');
        finalCalc += 3;
    }

    // machine that controls the weather. 
    function weatherChanger() public {
        sunny = !sunny;
    }

}

